import { Navigate } from 'react-router-dom';

export const PrivateRoutes = ({ children }) => {
  const isAuthenticated = localStorage.getItem('token');
  console.log(isAuthenticated);
  return isAuthenticated ? children : <Navigate to="/login" />;
};
